import React from 'react';
import servicesData from '../data/services'

function Home() {
  return (
      <div className="row">
        <div className="col-4">
          <div className="list-group" id="list-tab" role="tablist">
            {servicesData.map((service, key) => (
              <a className="list-group-item list-group-item-action" id={`list-${service.name}-list`} data-toggle="list" href={`#list-${service.name}`} role="tab" aria-controls={`${service.name}`}>{`${service.title}`}</a>
            ))}
          </div>
        </div>
        <div className="col-8">
          <div className="tab-content" id="nav-tabContent">
            {servicesData.map((service, key) => (
              <div className="tab-pane fade" id={`list-${service.name}`} role="tabpanel" aria-labelledby={`list-${service.title}-list`}>{service.description}</div>
            ))}
          </div>
        </div>
      </div>  
  );
}

export default Home;
